class ProjectListPhaseRequestModel {  int? manageProjectId;  String? dateStart;  String? dateEnd;  String? phaseStatus;  ProjectListPhaseRequestModel(      {this.manageProjectId, this.dateStart, this.dateEnd, this.phaseStatus});  ProjectListPhaseRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    dateStart = json['date_start'];    dateEnd = json['date_end'];    phaseStatus = json['phase_status'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['date_start'] = this.dateStart;    data['date_end'] = this.dateEnd;    data['phase_status'] = this.phaseStatus;    return data;  }}